import React from "react";
import styles from "./ErrorModal.module.css";
import Card from "./Card";
import Button from "./Button";

const ErrorModal = (props) => {
	return (
		<Card className={styles}>
			<header>
				<h2>Invalid Input</h2>
			</header>
			<Button subject={"Okay"} />
		</Card>
	);
};

export default ErrorModal;
